import { Text, View } from 'react-native'
import React, { PureComponent } from 'react'
import Navbar from './Navbar/Navbar'

export class BlogPlantes extends PureComponent {
  render() {
    return (
      <View>
        <Navbar></Navbar>
        <Text>BlogPlantes</Text>
      </View>
    )
  }
}

export default BlogPlantes;
